/**
 * @param {string} s
 * @param {string} t
 * @return {character}
 */
var findTheDifference = function (s, t) {
	//hashmap O(N) O(N)
	let hashMap = new Map();
	for (let c of s) {
		hashMap.set(c, hashMap.has(c) ? hashMap.get(c) + 1 : 1);
	}
	for (let c of t) {
		hashMap.set(c, hashMap.get(c) ? hashMap.get(c) - 1 : 1);
	}
	let rs;
	hashMap.forEach((v, k) => {
		if (v === 1) return (rs = k);
	});
	return rs;
};

var findTheDifference = function (s, t) {
	//Difference O(n) O(1)
	let rs = 0;
	for (let i = 0; i < s.length; i++) {
		rs -= s.charCodeAt(i);
		rs += t.charCodeAt(i);
	}
	rs += t.charCodeAt(s.length);
	return String.fromCharCode(rs);
};

var findTheDifference = function (s, t) {
	//Difference O(n) O(1)
	let rs = 0;
	for (let i = 0; i < s.length; i++) {
		rs ^= s.charCodeAt(i);
		rs ^= t.charCodeAt(i);
	}
	rs ^= t.charCodeAt(s.length);
	return String.fromCharCode(rs);
};

findTheDifference(
	'',
	''
);
